Initial sketch of out PPU would look like this: pub struct NesPPU { pub chr_rom: Vec<u8>, pub palette_table: [u8; 32], pub vram: [u8; 2048], pub oam_data: [u8; 256], pub mirroring: Mirroring,
} Where: chr_rom - visuals of a game stored on a cartridge palette_table - internal memory to keep palette tables used by a screen vram - 2 KiB banks of space to hold background information and oam_data - internal memory to keep state of sprites Mirroring and chr_rom are specific to each game and provided by a cartridge impl NesPPU { pub fn new(chr_rom: Vec<u8>, mirroring: Mirroring) -> Self { NesPPU { chr_rom: chr_rom, mirroring: mirroring, vram: [0; 2048], oam_data: [0; 64 * 4], palette_table: [0; 32], } }
}

