So far our dependency graph looks one-directional: The problem is that we want to deliver signals from PPU to CPU and Rust doesn't really allow to have dependency cycles easily. One way to overcome this is to replace the push model with pull. The CPU can ask if there are interrupts ready at the beginning of the interpret cycle. impl CPU {
//... pub fn run_with_callback<F>(&mut self, mut callback: F) where F: FnMut(&mut CPU), { // ... loop { if let Some(_nmi) = self.bus.poll_nmi_status() { self.interrupt_nmi(); } // … } }
} The final piece is to implement interrupt behavior. Upon receiving an interrupt signal the CPU: Finishes execution of the current instruction Stores Program Counter and Status flag on the stack Disables Interrupts by setting Disable Interrupt flag in the status register P Loads the Address of Interrupt handler routine from 0xFFFA (for NMI) Sets Program Counter register pointing to that address Interrupt handler would have to call RTI operation at the end to finish interrupt attendance. That would restore Status Flag and Program Counter position from the stack. Effectively going back to the execution flow where it was left off. fn interrupt_nmi(&mut self) { self.stack_push_u16(self.program_counter); let mut flag = self.status.clone(); flag.set(CpuFlags::BREAK, 0); flag.set(CpuFlags::BREAK2, 1); self.stack_push(flag.bits); self.status.insert(CpuFlags::INTERRUPT_DISABLE); self.bus.tick(2); self.program_counter = self.mem_read_u16(0xfffA); } In addition to scanline position, PPU would immediately trigger NMI if both of these conditions are met: PPU is VBLANK state "Generate NMI" bit in the controll Register is updated from 0 to 1. impl PPU for NesPPU {
// ... fn write_to_ctrl(&mut self, value: u8) { let before_nmi_status = self.ctrl.generate_vblank_nmi(); self.ctrl.update(value); if !before_nmi_status && self.ctrl.generate_vblank_nmi() && self.status.is_in_vblank() { self.nmi_interrupt = Some(1); } }
//..
}

