NES and Famicom supported a variety of controllers: Joypads Power pads Lightgun Zappers Arkanoid controllers And even keyboards We will emulate joypads as it's the most common and the easiest device to emulate Two joypads are mapped to 0x4016 and 0x4017 CPU address space, respectively. The same register can be used for both reading and writing. Reading from a controller reports the state of a button (1 - pressed, 0 - released). The controller reports a state of one button at a time. To get the state of all buttons, the CPU has to read the controller register 8 times. The order of reported Buttons is as follows: A -> B -> Select -> Start -> Up -> Down -> Left -> Right After reporting the state of the button RIGHT , the controller would continually return 1s for all following read, until a strobe mode change. The CPU can change the mode of a controller by writing a byte to the register. However, only the first bit matters. The controller operates in 2 modes: strobe bit on - controller reports only status of the button A on every read strobe bit off - controller cycles through all buttons So the most basic cycle to read the state of a joypad for CPU: Write 0x1 to 0x4016 (strobe mode on - to reset the pointer to button A) Write 0x00 to 0x4016 (strobe mode off) Read from 0x4016 eight times Repeat Ok, so let's sketch it out. We need 1 byte to store the status of all buttons: bitflags! { // https://wiki.nesdev.com/w/index.php/Controller_reading_code pub struct JoypadButton: u8 { const RIGHT = 0b10000000; const LEFT = 0b01000000; const DOWN = 0b00100000; const UP = 0b00010000; const START = 0b00001000; const SELECT = 0b00000100; const BUTTON_B = 0b00000010; const BUTTON_A = 0b00000001; }
} We need to track: strobe mode - on/off the status of all buttons an index of a button to be reported on the next read. pub struct Joypad { strobe: bool, button_index: u8, button_status: JoypadButton,
} impl Joypad { pub fn new() -> Self { Joypad { strobe: false, button_index: 0, button_status: JoypadButton::from_bits_truncate(0), } }
} Then we can implement reading from and writing to a controller: impl Joypad { //... pub fn write(&mut self, data: u8) { self.strobe = data & 1 == 1; if self.strobe { self.button_index = 0 } } pub fn read(&mut self) -> u8 { if self.button_index > 7 { return 1; } let response = (self.button_status.bits & (1 << self.button_index)) >> self.button_index; if !self.strobe && self.button_index <= 7 { self.button_index += 1; } response }
} Don't forget to connect the joypad to the BUS and map it for address 0x4016. One last step is to adjust our game loop to update the status of the joypad depending of a keyboard button being pressed or released on the host machine: fn main() { //... init sdl2 //... load the game let mut key_map = HashMap::new(); key_map.insert(Keycode::Down, joypad::JoypadButton::DOWN); key_map.insert(Keycode::Up, joypad::JoypadButton::UP); key_map.insert(Keycode::Right, joypad::JoypadButton::RIGHT); key_map.insert(Keycode::Left, joypad::JoypadButton::LEFT); key_map.insert(Keycode::Space, joypad::JoypadButton::SELECT); key_map.insert(Keycode::Return, joypad::JoypadButton::START); key_map.insert(Keycode::A, joypad::JoypadButton::BUTTON_A); key_map.insert(Keycode::S, joypad::JoypadButton::BUTTON_B); // run the game cycle let bus = Bus::new(rom, move |ppu: &NesPPU, joypad: &mut joypad::Joypad| { render::render(ppu, &mut frame); texture.update(None, &frame.data, 256 * 3).unwrap(); canvas.copy(&texture, None, None).unwrap(); canvas.present(); for event in event_pump.poll_iter() { match event { Event::Quit { .. } | Event::KeyDown { keycode: Some(Keycode::Escape), .. } => std::process::exit(0), Event::KeyDown { keycode, .. } => { if let Some(key) = key_map.get(&keycode.unwrap_or(Keycode::Ampersand)) { joypad.set_button_pressed_status(*key, true); } } Event::KeyUp { keycode, .. } => { if let Some(key) = key_map.get(&keycode.unwrap_or(Keycode::Ampersand)) { joypad.set_button_pressed_status(*key, false); } } _ => { /* do nothing */ } } } }); //...
} And here we are. Now we can play NES classics, using a keyboard. If you want to have a little bit of geeky fun, I highly recommend buying USB replicas of original NES controllers on Amazon. I'm not affiliated, I got these ones SDL2 fully supports joysticks , and with just a tiny adjustment in our game loop, we can have almost perfect NES experience. Ok, we've made quite a bit of progress here. The two major pieces left are: Support for scrolling - we will enable gaming into platformers. Audio Processing Unit - to get those sweet NES chiptunes back in our lives. The full source code for this chapter: GitHub

34.body:
The scroll is one of the primary mechanisms to simulate movement in space in NES games. It's an old idea of moving the viewport against the static background to create an illusion of movement through space. The scroll is implemented on the PPU level and only affects the rendering of background tiles (those stored in nametables). Sprites (OAM data) are not affected by this. PPU can keep two screens in memory simultaneously (remember one name table - 1024 bytes, and PPU has 2 KiB of VRAM). This doesn't look like a lot, but this is enough to do the trick. During the scroll the viewport cycles through those two nametables, while the CPU is busy updating the part of the screen that's not yet visible, but will be soon. That also means that most of the time, the PPU is rendering parts of both nametables. Because this exhausts all available console resources, early games had only 2 options for scrolling: horizontal or vertical. Old games were settled on the type of scroll for the whole game. Games that came later on had a mechanism to alternate scrolling between stages. And the most advanced games (like Zelda) provided the experience where a user can "move" in all 4 directions. Initially, the scroll was tightly coupled with mirroring - mostly because of the way NES handled overflow of a viewport from one nametable to another on hardware level. For games like Super Mario Bros (Horizontal Scroll) or Ice Climber (Vertical Scroll), the mechanism is entirely defined by: Mirroring type (set in a cartridge ROM header) Base Nametable address (value in PPU Control register) Status of PPU Scroll Register (X and Y shift values of the viewport, in pixels) Content of Nametables Remember, a background screen is defined by 960 tiles, each tile being 8x8 pixels, because PPU Scroll Register defines shifts in pixels, which means that on edges of the viewport, we can see parts of a tile. Updating PPU memory is relatively expensive, and the CPU can do this only during 241 - 262 scanlines. Because of these constraints, the CPU can update a relatively thin part (2x30 tiles wide area) of a screen per frame. If we render parts of the nametables that are not yet visible, we can see how the state of the world comes into existence a couple frames before entering the viewport. 2 last notes before jumping into implementation: The palette of a tile is defined by the nametable the tile belongs to, not by the base nametable specified in the Control register For horizontal scrolling the content of the base nametable always goes to the left part of the viewport (or top part in case of vertical scrolling) Implementing scroll rendering is not hard but requires attention to details. The most convenient mental model I could come up with is the following: For each frame, we would scan through both nametables. For each nametable we would specify visible part of the nametable: struct Rect { x1: usize, y1: usize, x2: usize, y2: usize,
} impl Rect { fn new(x1: usize, y1: usize, x2: usize, y2: usize) -> Self { Rect { x1: x1, y1: y1, x2: x2, y2: y2, } }
} And apply shift transformation for each visible pixel - shift_x, shift_y For example, For nametable 0x2400 : the visible area would be defined as (200, 0, 256, 240) and the shift would be (-200, 0) For nametable 0x2000 : the visible area is (0,0, 200, 240) and the shift is (56, 0) So, to draw a nametable we need to create a helper function: fn render_name_table(ppu: &NesPPU, frame: &mut Frame, name_table: &[u8], view_port: Rect, shift_x: isize, shift_y: isize) { let bank = ppu.ctrl.bknd_pattern_addr(); let attribute_table = &name_table[0x3c0.. 0x400]; for i in 0..0x3c0 { let tile_column = i % 32; let tile_row = i / 32; let tile_idx = name_table[i] as u16; let tile = &ppu.chr_rom[(bank + tile_idx * 16) as usize..=(bank + tile_idx * 16 + 15) as usize]; let palette = bg_pallette(ppu, attribute_table, tile_column, tile_row); for y in 0..=7 { let mut upper = tile[y]; let mut lower = tile[y + 8]; for x in (0..=7).rev() { let value = (1 & lower) << 1 | (1 & upper); upper = upper >> 1; lower = lower >> 1; let rgb = match value { 0 => palette::SYSTEM_PALLETE[ppu.palette_table[0] as usize], 1 => palette::SYSTEM_PALLETE[palette[1] as usize], 2 => palette::SYSTEM_PALLETE[palette[2] as usize], 3 => palette::SYSTEM_PALLETE[palette[3] as usize], _ => panic!("can't be"), }; let pixel_x = tile_column * 8 + x; let pixel_y = tile_row * 8 + y; if pixel_x >= view_port.x1 && pixel_x < view_port.x2 && pixel_y >= view_port.y1 && pixel_y < view_port.y2 { frame.set_pixel((shift_x + pixel_x as isize) as usize, (shift_y + pixel_y as isize) as usize, rgb); } } } }
} Then rendering background becomes relatively simple: pub fn render(ppu: &NesPPU, frame: &mut Frame) { let scroll_x = (ppu.scroll.scroll_x) as usize; let scroll_y = (ppu.scroll.scroll_y) as usize; let (main_nametable, second_nametable) = match (&ppu.mirroring, ppu.ctrl.nametable_addr()) { (Mirroring::VERTICAL, 0x2000) | (Mirroring::VERTICAL, 0x2800) => { (&ppu.vram[0..0x400], &ppu.vram[0x400..0x800]) } (Mirroring::VERTICAL, 0x2400) | (Mirroring::VERTICAL, 0x2C00) => { ( &ppu.vram[0x400..0x800], &ppu.vram[0..0x400]) } (_,_) => { panic!("Not supported mirroring type {:?}", ppu.mirroring); } }; render_name_table(ppu, frame, main_nametable, Rect::new(scroll_x, scroll_y, 256, 240 ), -(scroll_x as isize), -(scroll_y as isize) ); render_name_table(ppu, frame, second_nametable, Rect::new(0, 0, scroll_x, 240), (256 - scroll_x) as isize, 0 ); // … render sprites
} Implementing the vertical scroll is similar; we could reuse the same render_name_table helper function without changes. Just need to figure out proper addressing , shifts , and view_port parameters. The fully defined code for scrolling can be found here Support for scrolling means that now we can play old platformers like Super Mario Bros and Ice Climber. The final missing piece is APU. The full source code for this chapter: GitHub

